import React,{ Component } from 'react';
import Header from './Header';
import '../App.css';

class Register extends Component{
render(){
    return(
        <form>
            <legend className="form-legend">S</legend>
        </form>
    );
}
}
class Order extends Component {
    render(){
        return(
            <div>
            <Header />
            <Register />
            </div>
        );
    }
}
export default Order;
